import React from "react";
import Button from "@mui/material/Button";

const ButtonHeader = ({ ...props }) => {
  return (
    <div {...props}>
      <Button variant="text">DONANIM</Button>

      <Button variant="text">YAZILIM</Button>

      <Button variant="text">OYUNLAR</Button>

      <Button variant="text">YENİLİKLER</Button>

      <Button variant="text">YAPAY ZEKA</Button>

      <Button variant="text">AÇIK KAYNAK</Button>

      <Button variant="text">FRONT-END</Button>

      <Button color="yellow" variant="text">
        BACK-END
      </Button>
    </div>
  );
};

export default ButtonHeader;
